{"query":"mutation CHECKOUT_CREATE($checkoutInput: CheckoutCreateInput!) {
  checkoutCreate(input: $checkoutInput) {
    checkout {
      ...CheckoutData
    }
  }
}

fragment CheckoutData on Checkout {
  discountedProductsPrices
  id
  type
  token
  created
  lastChange
  voucherCode
  quantity
  email
  note
  callMe
  isCustomShippingMessage
  paymentType
