  totalPrice {
    gross {
      amount
    }
    net {
      amount
    }
  }
  subtotalPrice {
    gross {
      amount
    }
  }
  discountAmount {
    amount
  }
  shippingMethod {
    id
    type
  }
  shippingPrice {
    amount
  }
  shippingAddress {
    id
    firstName
    lastName
    countryArea
    city
    phone
    email
    street
    building
    apartment
    npAreaCode
    npCityCode
    npCitySearch
    npStreetCode
    npWarehouse
    npWarehouseCode
  }
  availableShippingMethods {
    id
    name
    description
    type
    price {
      amount
    }
    deliveryPoints {
      id
      address
      latitude
      longitude
      schedule
    }
    isCustomMessage
    customDeliveryMessage
  }
  availablePaymentTypes
  availablePrivatParts
  lines {
    id
    quantity
    totalPrice {
      gross {
        amount
      }
    }
    variant {
      id
      isFromInternalWarehouse
      name
      article
      sku
      stockQuantity
      customLogic
      price {
        amount
      }
      oldPriceOverride {
        amount
      }
      images {
        id
        url(name: "product_gallery", key: "products")
        url2x: url(name: "product_gallery_2x", key: "products")
      }
      product {
        id
        slug
        name
        onlineDelivery
        onlineDeliveryHelpText
        variants {
          id
          customLogic
        }
        category {
          name
          parent {
            name
          }
        }
      }
    }
  }
}
